import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Form, Field } from "@progress/kendo-react-form";

const Input = (fieldProps) => {
  const { fieldType, label, onChange, value } = fieldProps;
  return (
    <div>
      <label>
        { label }
        <input
          type={fieldType}
          value={value}
          onChange={onChange} />
      </label>
    </div>
  );
};


 const handleSubmit = (data, event) => {
   console.log(`
     Name:${data.uname}
     Email: ${data.email}
     Password: ${data.password}
   `);
   event.preventDefault();
 }

function CustomerLogin () {
   return (
     <Form>
       onSubmit={handleSubmit}
       initialValues={{}}
       render={(formRenderProps) => (
         <form className="customer-body" onSubmit={formRenderProps.onSubmit}>
         <center>
           <h3>Customer Login</h3>

           <Field
             label="Name:"
             name="name"
             fieldType="text"
             component={Input} />

           <Field
             label="Email:"
             name="email"
             fieldType="email"
             component={Input} />

           <Field
             label="Password:"
             name="password"
             fieldType="password"
             component={Input} />

           <button>Submit</button>
          </center>
         </form>
       )}>
     </Form>
   );
 }

export default CustomerLogin;
